import React from 'react';
import Card from './Card'
import items from './items'
import {ListItem, ListItemText, ListItemIcon, IconButton, makeStyles, Checkbox} from '@material-ui/core/';

const usestyles = makeStyles({
    radioButton: {
        borderRadius: 100,
        Color: 'black',
    },
})

const IngredientList = items[0].Ingredients.map((Items,i) =>{
    const classes = usestyles;

    return(
        <ListItem dense ContainerComponent="li">
            <Checkbox id={i}/>
            <label for={i}>
                <ListItemText primary={Items}></ListItemText>
            </label>

        </ListItem>
    );
})




export default IngredientList;
